      | 363934 -> { ItemTypeData.id= 363934; name= "Assault A-I"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  A hydra-membrane graft directly integrates the suit with the wearer’s neurological system. While painful, this neuromorphic interface improves processing speed and reaction time while also allowing the suit to draw a limited, renewable supply of energy from the wearer’s body, which in turn can be applied to reinforce shield systems or augment overall power output. Aesthetics are a vital aspect of the suit’s design, because to the Amarr, aesthetics are function. Enshrined within the armor, the wearer becomes a vessel, the embodiment of God’s will and an instrument of holy wrath, unmistakable, and feared, by all who look upon him. To the Amarr, the dropsuit itself is the weapon.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 364031 -> { ItemTypeData.id= 364031; name= "Logistics G/1-Series"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.  Gallente military doctrine places a premium on human life, favoring technological solutions that augment or even entirely replace human combatants in a conflict. Unsurprisingly, the Gallente Logistics suit is designed to minimize loss of life on the battlefield. A resilient suit, it features an array of biomechanical sensors to monitor ongoing health, while the copious equipment slots allow it to carry everything needed to effectively render aid to victims.  When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 364322 -> { ItemTypeData.id= 364322; name= "Master Recruiter Assault C-II"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    A flat-coil e5000 fifth generation fusion core runs up the inside of the back plate, powering the entire suit. Its output and heat buildup are controlled by a L2 “Gatekeeper” regulator conduit, which connects directly to the sensor system at the base of the neck. Every joint is reinforced with kinetic sensors and two-way, high torque servos to enhance the soldier’s strength, balance, and resistance to impact forces. The suit’s helmet has more integrated sensor, communication, targeting, and data processing systems than most civilian vehicles. As is common with Caldari designs, armor plating is limited to vital areas, relying instead on high-power shield systems to protect the wearer.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
